  body {
    background: white;
    // font-family: 'Operator Mono', monospace;
    font-family: 'sans-serif';
    font-weight: 900;
    font-size: 1rem;
    background: #000000;
    color: white;
  }
  * {
    font-family: 'Operator Mono', monospace;
    box-sizing: border-box;
  }
  h2 {
    text-align: center;
    font-style: italic;
  }
`;

const PageStyles = styled.div`
  max-width: 500px;
  margin: 0 auto;
`;

const IndexPage = () => (
  <PageStyles>
    <h2>JavaScript Drone ðŸš€</h2>
    <GlobalStyle />
    <Commands />
    <DroneState />
  </PageStyles>
);

export default IndexPage;
